import React from 'react'
import '../App.css';


export default function Album({ album }) {

    console.log(album)

    return (
        <div className="album">
            <h2>{album.album_name}</h2>
            <img src={album.cover_image} alt={album.album_name} />
            <h3>{album.artist_name}</h3>
            <h4>{album.release_date}</h4>
        </div>
    )
}
